import { Link } from "react-router-dom";

const MenuSuperior = () => {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/">Inclusão de Livros</Link>
        </li>
        <li>
          <Link to="/manut">Manutenção de Livros</Link>
        </li>
        <li>
          <Link to="/resumo">Resumo de Livros</Link>
        </li>
      </ul>
    </nav>
  );
};

export default MenuSuperior;
